export async function GetBranchChildren_B(branchCode, includeEmployees) {
  if (branchCode === 812) return new Promise(resolve => {
    setTimeout(() => resolve(loadData), 1000);
  });else return new Promise(resolve => {
    var key = branchCode.toString();
    setTimeout(() => resolve(db[key]), 1000);
  });
}
export async function GetBranchChildren(ParentKey) {
  const url = `${StructureURL}${ParentKey ? `/${ParentKey}` : ""}`;
  let obj = [];
  const response = await fetch(url, {
    method: "GET"
  });
  const json = await response.json();

  if (!ParentKey) {
    json.map(Main => {
      obj.push({
        key: Main.code,
        title: Main.name,
        children: [],
        dbid: Main.id,
        isBranch: true
      });
    });
  } else {
    json.childBranches.map(Main => {
      obj.push({
        key: Main.code,
        title: Main.name,
        children: [],
        dbid: Main.id,
        isBranch: true
      });
    });
    json.childEmployees.map(Main => {
      obj.push({
        key: Main.staffNo,
        title: `${Main.firstName} ${Main.lastName}`,
        children: [],
        dbid: Main.id,
        isBranch: false
      });
    });
  }

  return obj;
}
export async function SearchStructure(searchKey, Channel) {
  return new Promise(resolve => {
    setTimeout(() => resolve(searchData), 1000);
  });
}
export async function SearchStructure_A(ParentKey) {
  const url = `${SearchURL}${ParentKey}`;
  let obj = [];
  const response = await fetch(url, {
    method: "GET"
  });
  const json = await response.json();
  json.map(Main => {
    obj.push({
      key: Main.data[1].value,
      title: Main.data[2].value,
      children: [],
      isBranch: Main.data[3].value === "0" ? false : true
    });
  });
  return new Promise(obj);
}

