export async function SearchStructure_A(ParentKey) {
  const url = `${SearchURL}${ParentKey}`;
  let obj = [];
  const response = await fetch(url, {
    method: "GET",
  });
  const json = await response.json();
  json.map((Main) => {
    obj.push({
      key: Main.data[1].value,
      title: Main.data[2].value,
      children: [],
      isBranch: Main.data[3].value === "0" ? false : true,
    });
  });
  return new Promise(obj);
}
